import { BrowserRouter, Routes, Route } from 'react-router-dom';

// import components
import Header from './components/Header';
import Home from './components/Home';
import Games from './components/Games';
import Infographics from './components/Infographics';
import ContactForm from './components/ContactForm';
import ThankYou from './components/ThankYou';

// import css ðŸŽ¨
import './styles/App.css';



function App() {
  return (
    <div className="App">
      <Header />




      <BrowserRouter>
        <Routes>
          <Route element={<Home />} path="/" default />
          <Route element={<ContactForm />} path="/ContactForm" default />
          <Route element={<Games />} path="/Games" default />
          <Route element={<Infographics />} path="/Infographics" default />
          <Route element={<ThankYou />} path="/ThankYou" default />
        </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
